/* My Inside Style
   name inside.tensor.ru - accordion christmas icon
   url  https://userstyles.org/styles/121962/inside-tensor-ru-accordion-christmas-icon
   git  https://github.com/iNovozhilov/InsideTensorUserStyle
*/

@-moz-document domain(inside.tensor.ru) {
   .navigation-LeftNavigation__icon.contragents::before,
   .navigation-LeftNavigation__icon.business:before,
   .navigation-LeftNavigation__icon.accounting:before,
   .navigation-LeftNavigation__icon.documents:before,
   .navigation-LeftNavigation__icon.staff:before,
   .navigation-LeftNavigation__icon.work:before,
   .navigation-LeftNavigation__icon.contacts:before,
   .navigation-LeftNavigation__icon.calendar:before,
   .navigation-LeftNavigation__icon.calendar:after,
   .navigation-LeftNavigation__icon.ca_navication:before,
   .navigation-LeftNavigation__icon.tel:before {
      content: '' !important;
   }
   .navigation-LeftNavigation__icon.contragents,
   a[dataid="contragents"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 8px 6px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.business,
   a[dataid="business"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 8px 6px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.accounting,
   a[dataid="accounting"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 10px 6px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.documents,
   a[dataid="documents"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 6px 6px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.staff,
   a[dataid="staff"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 8px 6px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.work,
   a[dataid="work"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 8px 7px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.contacts,
   a[dataid="contacts"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 7px 6px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.calendar,
   a[dataid="calendar"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 8px 6px !important;
      font-size: 0px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.ca_navication,
   a[dataid="ca_navication"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 8px 6px !important;
      background-image: url('data:image/png;base64,') !important;
   }
   .navigation-LeftNavigation__icon.tel,
   a[dataid="tel"]>span.navigation-LeftNavigation__icon {
      background-repeat: no-repeat !important;
      background-position: 7px 6px !important;
      background-image: url('data:image/png;base64,') !important;
   }
}
